import React from "react";

function Dashboard() {
  return (
    <div>
      <div
        style={{
          height: "40vh",
          width: "80vw",
        }}
      >
        <div
          style={{
            height: "15vh",
            width: "20vw",
            backgroundColor: "lightblue",
          }}
        >
          <p>12 Quiz</p>
          <p>Created </p>
        </div>
      </div>
      <div
        style={{
          height: "60vh",
          width: "80vw",
          backgroundColor: "yellow",
        }}
      ></div>
    </div>
  );
}

export default Dashboard;
